import React from "react";

function Navbar() {
  return (
    <nav className="navBar">
      <img
        className="navBar__logo"
        src="https://www.google.com/imgres?imgurl=https%3A%2F%2Fimage.shutterstock.com%2Fimage-vector%2Fshop-logo-good-260nw-1290022027.jpg&imgrefurl=https%3A%2F%2Fwww.shutterstock.com%2Fsearch%2Fshopping%2Blogo&tbnid=gymJuTNQJwUfxM&vet=12ahUKEwiU2qSDiMT4AhVajtgFHVJdC38QMygBegUIARDgAQ..i&docid=nEx5cETXAGegjM&w=260&h=280&q=shop%20logo&ved=2ahUKEwiU2qSDiMT4AhVajtgFHVJdC38QMygBegUIARDgAQ"
        alt="error"
      />
    </nav>
  );
}

export default Navbar;
